import React, {useState, useEffect} from 'react'
import useAxios from '../utils/useAxios'

const TodoPage = () => {
    let [todos, setDotos] = useState([])

    let api = useAxios()

    useEffect(()=> {
        getTodos()
    }, [])


    let getTodos = async() =>{
        let response = await api.get('/api/')

        if(response.status === 200){
            setDotos(response.data)
        }

    }

    return (
        <div>
            <h1>Todo Page</h1>
            <p>Todo</p>
            <ul>
                {todos.map(todo => (
                    <li key={todo.id} >{todo.title} - {todo.description}</li>
                ))}
            </ul>
        </div>
    )
}

export default TodoPage
